import "./menu.scss"

export default function Menu() {
    return (
        <div className="menu">
            <ul>
                <li><a href="#intro"></a>Home</li>
                <li><a href="#portfolio"></a>Portfolio</li>
                <li><a href="#contact"></a>Contact</li>
            </ul>
        </div>
    )
}
